import { setFileScope, endFileScope } from "@vanilla-extract/css/fileScope";
import { style } from "@vanilla-extract/css";
setFileScope("src/lib/components/useToast/Toast.css.ts?used", "braid-design-system");
const toast = style({
  pointerEvents: "all"
}, "toast");
endFileScope();
export {
  toast
};
